var something={};
const fetchData=()=>{
        console.log('fetch data method is working');
        fetch('http://localhost:9000')
        .then(response => response.json())
        .then(data =>{setSomething(data) }).catch(error=>{console.log(error)
                });
        const setSomething=(data)=>{
                something={...data}
        }
        }
export  {fetchData,something};
